import React from 'react';

export function ImageComponent({ productImage }) {  
   
  productImage=atob(productImage);
  const base64Image = btoa(productImage);

  return (
    <div>
      <img src={`data:image/png;base64,${base64Image}`} alt="Product" />
    </div>
  );
}
